import React from "react";
import {
  Drawer as MUIDrawer,
  ListItem,
  List,
  ListItemIcon,
  ListItemText
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import PermIdentityIcon from '@material-ui/icons/PermIdentity';
import { withRouter } from "react-router-dom";
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import clsx from 'clsx';
import SvgIcon from '@material-ui/core/SvgIcon';

const useStyles = makeStyles({
  drawer: {
    width: "68px"
  },
  drawerPaper: {
    color: "#252F4A"
  },
  drawerList: {
    height: '100%',
    display: 'flex',
    flexDirection: 'column'
  },
  listItemContainer: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent:"center",
    padding: 0,
    color: "#FFF",
  },
  listIcon: {
    color: "#FFF",
    justifyContent: 'center'
  },
  exit: {
    marginTop: 'auto'
  },
});

const Drawer = props => {
  const { history } = props;
  const classes = useStyles();
  const itemsList = [
    {
      text: "Россети",
      icon: <SvgIcon><path width="20px"
      height="20px"
      fill="white" d="M18,17 C18,17.552 17.552,18 17,18 L14,18 C13.448,18 13,17.552 13,17 L13,14 C13,13.448 13.448,13 14,13 L17,13 C17.552,13 18,13.448 18,14 L18,17 Z M18,11 L13,11 C11.895,11 11,11.895 11,13 L11,18 C11,19.105 11.895,20 13,20 L18,20 C19.105,20 20,19.105 20,18 L20,13 C20,11.895 19.105,11 18,11 L18,11 Z M18,6 C18,6.552 17.552,7 17,7 L14,7 C13.448,7 13,6.552 13,6 L13,3 C13,2.448 13.448,2 14,2 L17,2 C17.552,2 18,2.448 18,3 L18,6 Z M18,0 L13,0 C11.895,0 11,0.895 11,2 L11,7 C11,8.105 11.895,9 13,9 L18,9 C19.105,9 20,8.105 20,7 L20,2 C20,0.895 19.105,0 18,0 L18,0 Z M7,17 C7,17.552 6.552,18 6,18 L3,18 C2.448,18 2,17.552 2,17 L2,3 C2,2.448 2.448,2 3,2 L6,2 C6.552,2 7,2.448 7,3 L7,17 Z M7,0 L2,0 C0.895,0 0,0.895 0,2 L0,18 C0,19.105 0.895,20 2,20 L7,20 C8.105,20 9,19.105 9,18 L9,2 C9,0.895 8.105,0 7,0 L7,0 Z" /></SvgIcon>,
      onClick: () => history.push("/")
    },
    {
      text: "Кабинет",
      icon: <PermIdentityIcon />,
      onClick: () => history.push("/profile")
    }
  ];
  return (
    <MUIDrawer variant="permanent" className={classes.drawer}>
      <List className={classes.drawerList}>
        {itemsList.map((item, index) => {
          const { text, icon, onClick } = item;
          return (
            <ListItem button key={text} onClick={onClick} className={classes.listItemContainer}>
              {icon && <ListItemIcon className={classes.listIcon}>{icon}</ListItemIcon>}
              <ListItemText primary={text} />
            </ListItem>
          );
        })}
        <ListItem button className={ clsx(classes.listItemContainer, classes.exit)}>
          <ListItemIcon className={classes.listIcon}>
            <ExitToAppIcon />
          </ListItemIcon>
          <ListItemText primary="Выход" />
        </ListItem>
      </List>


    </MUIDrawer>
  );
};

export default withRouter(Drawer);
